import React from "react";
import * as TABLE from "./styles/table.styles";

const Attendance = () => {
  return (
    <React.Fragment>
      <TABLE.TableTypeSection>
        <TABLE.TBHEADER></TABLE.TBHEADER>
      </TABLE.TableTypeSection>
    </React.Fragment>
  );
};

export default Attendance;
